import React from "react";
import "./nav.css";

function Home() {
    return (
        <div className="section-center">
            <h1 className="mb-0">Future Mart</h1>

            <h3>Welcome to the Future Mart! Start Exploring Now.</h3>
            <p>Ideal for supermarkets and shopping malls. Customers can interact virtually and physically with the product.</p>
            <p>The product is used for negotiation on certain occasions with the aid of ontology.</p>

            <p>The goal is to make business more efficient by using ontology-based negotiation through a salesman-bot.</p>
            <p>Salesman-bot makes service more reliable and easier for people using supermarkets, shopping malls, and eCommerce.</p>

            <img src="https://i.postimg.cc/4yYBmhFD/0c428e8239727076ce2e1716b1ee529eff79ad34466fea57e80c3ebc4336a019821c607b17d5ada3-car-202x158.gif" /><br/>

            <button>Get Started</button>
        </div>
    )
}

export default Home;
